function UseEffectfn() {
  const [count,setCount] = useState();

  useEffect(()=>{
    document.title = `click count ${count}`;
  })
    return (
    <div>
      <h1 onclick={setCount(count+1)}>count</h1>
    </div>
  )
}

export default UseEffectfn;
